import React, { useState, useEffect } from 'react';
import {Navbar, Nav, Container} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import styled from "styled-components";
import {useNavigate} from 'react-router-dom';
import logo from '../imgs/logo.png';

const Navigate = () => {
    const navigate = useNavigate();

    const MainButton = () => {      //로고 클릭시 메인페이지 이동
        navigate("/");
    }
    return (
        // <Navbar bg="light" data-bs-theme="light">
        //     <Container>
        //         <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        //         <Nav className="me-auto">
        //             <Nav.Link href="#home">Home</Nav.Link>
        //             <Nav.Link href="#features">Features</Nav.Link>
        //             <Nav.Link href="#pricing">Pricing</Nav.Link>
        //         </Nav>
        //     </Container>
        // </Navbar>
        <Navbar style={{position: "fixed", backgroundColor : "white", boxShadow : "1.5px 1.5px 1.5px 1.5px #F3F4F6", width: "100vw", height: "10vh", zIndex: "1000"}} >
                <Navbar.Brand>
                    <Nav_Str>
                        <UserImg onClick={MainButton}>
                            <img className="LogoImage" alt="logo" src={logo}  />
                        </UserImg>
                    </Nav_Str>
                </Navbar.Brand>
                <Nav className="me-auto">

                </Nav>
        </Navbar>
    )
}

const Nav_Str = styled.div`
  display: flex;
  flexDirection: row;
  width: 100vw;
  justifyContent: space-between;
  align-items: center;
  background-color: blue;
`
const UserImg = styled.button`
  background: none;
  border: none;

  left: 2rem;

`
const LogoImage = styled.img`
  height: 2vh;  // 로고 이미지의 높이를 조정합니다.
`

export default Navigate;
